PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "tournaments_lake" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(256) NOT NULL, "paper" bool NOT NULL, "google_maps" varchar(4096) NOT NULL);
CREATE TABLE IF NOT EXISTS "tournaments_ramp" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(128) NOT NULL, "google_maps" varchar(4096) NOT NULL, "lake_id" integer NOT NULL REFERENCES "tournaments_lake" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "polls_lakepoll_choices" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "lakepoll_id" bigint NOT NULL REFERENCES "polls_lakepoll" ("id") DEFERRABLE INITIALLY DEFERRED, "lake_id" integer NOT NULL REFERENCES "tournaments_lake" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "polls_lakevote" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "timestamp" date NOT NULL, "angler_id" integer NOT NULL REFERENCES "users_angler" ("user_id") DEFERRABLE INITIALLY DEFERRED, "choice_id" integer NOT NULL REFERENCES "tournaments_lake" ("id") DEFERRABLE INITIALLY DEFERRED, "poll_id" bigint NOT NULL REFERENCES "polls_lakepoll" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "polls_lakepoll" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "end_date" date NULL, "end_time" time NULL, "complete" bool NOT NULL, "description" text NULL, "name" varchar(256) NOT NULL, "event_id" integer NULL REFERENCES "tournaments_events" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "tournaments_teamresult" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "buy_in" bool NULL, "num_fish" smallint NULL, "team_name" varchar(1024) NULL, "manual_edit" bool NOT NULL, "place_finish" smallint NULL, "disqualified" bool NOT NULL, "total_weight" decimal NOT NULL, "num_fish_dead" smallint NULL, "num_fish_alive" smallint NOT NULL, "penalty_weight" decimal NOT NULL, "big_bass_weight" decimal NOT NULL, "result_1_id" integer NOT NULL REFERENCES "tournaments_result" ("id") DEFERRABLE INITIALLY DEFERRED, "result_2_id" integer NULL REFERENCES "tournaments_result" ("id") DEFERRABLE INITIALLY DEFERRED, "tournament_id" integer NOT NULL REFERENCES "tournaments_tournament" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tournaments_result" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "buy_in" bool NOT NULL, "points" smallint NULL, "num_fish" smallint NOT NULL, "dq_points" bool NOT NULL, "locked" bool NOT NULL, "place_finish" smallint NOT NULL, "total_weight" decimal NOT NULL, "disqualified" bool NOT NULL, "num_fish_dead" smallint NOT NULL, "num_fish_alive" smallint NULL, "penalty_weight" decimal NOT NULL, "big_bass_weight" decimal NOT NULL, "angler_id" integer NOT NULL REFERENCES "users_angler" ("user_id") DEFERRABLE INITIALLY DEFERRED, "tournament_id" integer NOT NULL REFERENCES "tournaments_tournament" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "tournaments_events" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "date" date NULL, "type" varchar(25) NOT NULL, "month" varchar(20) NOT NULL, "start" time NULL, "finish" time NULL, "year" smallint NOT NULL);
CREATE TABLE IF NOT EXISTS "tournaments_payoutmultipliers" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "club" decimal NOT NULL, "place_1" decimal NOT NULL, "place_2" decimal NOT NULL, "place_3" decimal NOT NULL, "charity" decimal NOT NULL, "big_bass" decimal NOT NULL, "entry_fee" decimal NOT NULL, "paid_places" smallint NOT NULL, "per_boat_fee" decimal NOT NULL, "fee_breakdown" text NOT NULL, "year" smallint NOT NULL);
CREATE TABLE IF NOT EXISTS "tournaments_ruleset" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "rules" text NOT NULL, "payout" text NOT NULL, "weigh_in" text NOT NULL, "entry_fee" text NOT NULL, "limit_num" smallint NOT NULL, "dead_fish_penalty" decimal NOT NULL, "max_points" smallint NOT NULL, "big_bass_breakdown" text NOT NULL, "zeroes_points_offset" smallint NOT NULL, "buy_ins_points_offset" smallint NOT NULL, "disqualified_points_offset" smallint NOT NULL, "year" smallint NOT NULL);
CREATE TABLE IF NOT EXISTS "users_officers" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "position" varchar(50) NOT NULL, "angler_id" integer NOT NULL REFERENCES "users_angler" ("user_id") DEFERRABLE INITIALLY DEFERRED, "year" smallint NOT NULL);
CREATE TABLE IF NOT EXISTS "tournaments_calendarevent" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "title" varchar(100) NOT NULL, "description" text NULL, "date" date NOT NULL, "start_time" time NULL, "end_time" time NULL, "category" varchar(20) NOT NULL, "priority" varchar(10) NOT NULL, "external_url" varchar(200) NULL, "is_recurring" bool NOT NULL, "recurring_type" varchar(20) NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "lake_id" integer NULL REFERENCES "tournaments_lake" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_angler" ("user_id" integer NOT NULL PRIMARY KEY REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "member" bool NULL, "date_joined" date NOT NULL, "phone_number" varchar(128) NOT NULL, "image" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "tournaments_tournament" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(256) NOT NULL, "points_count" bool NOT NULL, "team" bool NOT NULL, "paper" bool NOT NULL, "facebook_url" varchar(512) NOT NULL, "instagram_url" varchar(512) NOT NULL, "description" text NOT NULL, "complete" bool NOT NULL, "event_id" integer NULL REFERENCES "tournaments_events" ("id") DEFERRABLE INITIALLY DEFERRED, "lake_id" integer NULL REFERENCES "tournaments_lake" ("id") DEFERRABLE INITIALLY DEFERRED, "payout_multiplier_id" integer NULL REFERENCES "tournaments_payoutmultipliers" ("id") DEFERRABLE INITIALLY DEFERRED, "ramp_id" integer NULL REFERENCES "tournaments_ramp" ("id") DEFERRABLE INITIALLY DEFERRED, "rules_id" integer NULL REFERENCES "tournaments_ruleset" ("id") DEFERRABLE INITIALLY DEFERRED);
