INSERT INTO tournaments_tournament VALUES(13,'January Kickoff Tournament',1,0,0,'https://www.facebook.com/SouthAustinBassClub','https://www.instagram.com/south_austin_bass_club','Start the 2024 season strong at Lake Travis! Early morning bite should be good with cooler water temps.',1,14,81,6,145,6);
INSERT INTO tournaments_tournament VALUES(14,'February Team Challenge',1,1,0,'https://www.facebook.com/SouthAustinBassClub','https://www.instagram.com/south_austin_bass_club','Team tournament on beautiful Canyon Lake. Clear water means finesse tactics will be key.',1,15,87,6,157,6);
INSERT INTO tournaments_tournament VALUES(15,'March Madness Tournament',1,0,0,'https://www.facebook.com/SouthAustinBassClub','https://www.instagram.com/south_austin_bass_club','Spring patterns are starting to emerge! Look for bass moving shallow as water temps rise.',1,16,86,6,155,6);
INSERT INTO tournaments_tournament VALUES(16,'April Spawning Spectacular',1,0,0,'https://www.facebook.com/SouthAustinBassClub','https://www.instagram.com/south_austin_bass_club','Prime spawning season! Be respectful of bedding bass and practice catch & release.',1,17,84,6,152,6);
INSERT INTO tournaments_tournament VALUES(17,'May Team Derby',1,1,0,'https://www.facebook.com/SouthAustinBassClub','https://www.instagram.com/south_austin_bass_club','Team tournament on clear Stillhouse Hollow. Rocky structure and deep water make for exciting fishing.',1,18,93,6,166,6);
INSERT INTO tournaments_tournament VALUES(18,'June Summer Slam',1,0,0,'https://www.facebook.com/SouthAustinBassClub','https://www.instagram.com/south_austin_bass_club','Beat the heat with an early start! Summer patterns are in full effect.',1,19,94,6,168,6);
INSERT INTO tournaments_tournament VALUES(19,'July Independence Tournament',1,0,0,'https://www.facebook.com/SouthAustinBassClub','https://www.instagram.com/south_austin_bass_club','Celebrate independence with some great bass fishing! Very early start to beat the Texas heat.',1,20,92,6,164,6);
INSERT INTO tournaments_tournament VALUES(20,'August Heat Wave Challenge',1,0,0,'https://www.facebook.com/SouthAustinBassClub','https://www.instagram.com/south_austin_bass_club','Extreme early start for the hottest month! Deep water tactics will be essential.',1,21,96,6,171,6);
INSERT INTO tournaments_tournament VALUES(21,'September Fall Kickoff',1,0,0,'https://www.facebook.com/SouthAustinBassClub','https://www.instagram.com/south_austin_bass_club','World-famous Lake Fork! This could be the tournament where someone catches their personal best.',0,22,99,6,177,6);
INSERT INTO tournaments_tournament VALUES(22,'October Team Championship',1,1,0,'https://www.facebook.com/SouthAustinBassClub','https://www.instagram.com/south_austin_bass_club','Team championship on massive Toledo Bend! Fall patterns should produce some memorable catches.',0,23,97,6,173,6);
INSERT INTO tournaments_tournament VALUES(23,'November Pre-Winter Classic',1,0,0,'https://www.facebook.com/SouthAustinBassClub','https://www.instagram.com/south_austin_bass_club','Last chance for big weights before winter! Sam Rayburn always delivers quality bass.',0,24,98,6,175,6);
INSERT INTO tournaments_tournament VALUES(24,'December Year-End Classic',1,0,0,'https://www.facebook.com/SouthAustinBassClub','https://www.instagram.com/south_austin_bass_club','Year-end tournament at the warm-water discharge lake. Great place to fish in cooler weather!',0,25,89,6,161,6);
